import React from 'react';
import { Avatar, Box } from '@mui/material';

function SpellImages({ spells, version }) {
  return (
    <Box display="flex" gap={0.5}>
      {spells.map((spellId, index) => (
        <Avatar
          key={index}
          src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/spell/Summoner${spellId}.png`}
          alt={`Spell ${spellId}`}
          sx={{ width: 32, height: 32 }}
        />
      ))}
    </Box>
  );
}

export default SpellImages;
